namespace OsianJudger.Game.Replay {
    public class ReplayTemplate {
        public static readonly string Template =
@"
<html>
  <head>
    <meta charset='utf-8' />
  </head>
  <body>
    <div id='controls'>
      Speed: <span id='speed_disp'>1</span><input type='range' min='0' max='100' value='10' id='speed_slider' />
      Progress: <input type='range' min='0' max='10000' value='0' id='progress_slider' onchange='reposition()' />
    </div>
    <div id='meta'>
      Left Player: Cost <span id='basics_0'></span> Base <span id='basics_2'></span>
      Right Player: Cost <span id='basics_1'></span> Base <span id='basics_3'></span>
    </div>
    <div id='main_canvas_container'><canvas width=896 height=704 id='main_canvas'></canvas></div>
    <div id='texture_resources' style='display: none'>
      <img src='data:image/png;base64,' id='archer0'/>
      <img src='data:image/png;base64,' id='archer1'/>
      <img src='data:image/png;base64,' id='archer2'/>
      <img src='data:image/png;base64,' id='archer3'/>
      
      <img src='data:image/png;base64,' id='buster0'/>
      <img src='data:image/png;base64,' id='buster1'/>
      <img src='data:image/png;base64,' id='buster2'/>
      <img src='data:image/png;base64,' id='buster3'/>
      
      <img src='data:image/png;base64,' id='castle0'/>
      <img src='data:image/png;base64,' id='castle1'/>
      <img src='data:image/png;base64,' id='castle2'/>
      <img src='data:image/png;base64,' id='castle3'/>
      
      <img src='data:image/png;base64,' id='dragon0'/>
      <img src='data:image/png;base64,' id='dragon1'/>
      <img src='data:image/png;base64,' id='dragon2'/>
      <img src='data:image/png;base64,' id='dragon3'/>
      
      <img src='data:image/png;base64,' id='archera0'/>
      <img src='data:image/png;base64,' id='archera1'/>
      <img src='data:image/png;base64,' id='archera2'/>
      <img src='data:image/png;base64,' id='archera3'/>
      
      <img src='data:image/png;base64,' id='teaml0'/>
      <img src='data:image/png;base64,' id='teamr0'/>
      <img src='data:image/png;base64,' id='teamn0'/>
      
      <img src='data:image/png;base64,' id='obstacle0'/>
      
      <img src='data:image/png;base64,' id='bg'/>
      <img src='data:image/png;base64,' id='ug'/>
    </div>
    <script>
      var cvs = document.getElementById('main_canvas');
      var ctx = cvs.getContext('2d');
      ctx.font = '10px msyh';
      ctx.fillStyle = '#ffffff';
      var speedv = 1.0;
      var timevar = 0.0;
      var pausing = false;
      var data = [$_DATA];
      
      function draw(state) {
        for (var i = 0; i < state.length; i++) {
          var obj = state[i];
          var texture = obj.texture;
          var positioning = obj.positioning;
          var gridPosX = obj.x;
          var gridPosY = obj.y;
          var size = obj.size;
          var count_s = obj.count_s;
          var graphicY = positioning === 'G' ? obj.x * 64 + 224 : obj.x;
          var graphicX = positioning === 'G' ? obj.y * 64 + 64 : obj.y;
          if (size) {
              if (obj.alpha)
                ctx.globalAlpha = obj.alpha;
              if (obj.flip) {
                graphicX = -graphicX - size.x;
                ctx.scale(-1, 1);
              }
              ctx.drawImage(document.getElementById(texture), graphicX, graphicY, size.x, size.y);
              if (obj.alpha)
                ctx.globalAlpha = 1.0;
              if (obj.flip) {
                graphicX = -graphicX - size.x;
                ctx.scale(-1, 1);
              }
              if (count_s)
                  ctx.fillText(count_s, graphicX + size.x / 2.0 + 5, graphicY + size.y - 6);
          }
          else
              ctx.drawImage(document.getElementById(texture), graphicX, graphicY);
        }
      }
      
      function flerp(a, b, t) {
          return b * t + a * (1.0 - t);
      }
      
      function xcompensation(texture) {
          if (texture === 'buster') return -0.15;
          if (texture === 'castle') return -0.3;
          if (texture === 'dragon') return -0.45;
          return 0;
      }
      
      var frameTime = 0.8;
      
      function reposition() {
          timevar = document.getElementById('progress_slider').value / 10000.1 * data.length * frameTime;
      }
      
      function update() {
          speedv = parseInt(document.getElementById('speed_slider').value) / 10.0;
          document.getElementById('speed_disp').innerHTML = speedv;
          var frame = parseInt(timevar / frameTime);
          var elapse = (timevar - frameTime * frame) / frameTime;
          if (frame >= data.length)
              return;
          if (data[frame].w) {
              alert(data[frame].w);
              timevar += frameTime;
              return;
          }
          for (var i = 0; i < 4; i++)
            document.getElementById('basics_' + i).innerHTML = data[frame].b[i];
          var ds = [];
          ds.push({texture: 'bg', x: 0, y: 0});
          for (var i = 0; i < data[frame].c; i++) {
              var stateObj = {
                  texture: data[frame].s[i].t + (data[frame].s[i].y !== data[frame].e[i].y ? (parseInt(elapse / 0.2001) % 4) : 0),
                  alpha: flerp(data[frame].s[i].a, data[frame].e[i].a, elapse),
                  size: {x: 64, y: 64},
                  flip: data[frame].s[i].o === 1,
                  positioning: 'G',
                  x: flerp(data[frame].s[i].x, data[frame].e[i].x, elapse) + xcompensation(data[frame].s[i].t),
                  y: flerp(data[frame].s[i].y, data[frame].e[i].y, elapse),
                  count_s: data[frame].s[i].c
              };
              ds.push(stateObj);
          }
          ds.push({texture: 'ug', x: 0, y: 0});
          draw(ds);
      }
      
      setInterval(function() { if (!pausing) { timevar += 0.02 * speedv; update(); } }, 20);
    </script>
  </body>
</html>
";
    }
}
